import Head from 'next/head';

import Header from './header';
import Footer from './footer';

export const author = 'Dave Regg';
export const siteTitle = 'Next.js Weather App';

const Layout = props => {
  return (
    <div>
      <Head>
        <title>Weather App</title>
      </Head>
      <Header />
      {props.children}
      <Footer />
    </div>
  )
}

export default Layout;
